import { GET_DEVELOPER, ADD_DEVELOPER, DELETE_DEVELOPER, DEVELOPER_ERROR } from '../actions/types';

const initialState =  {
    logs: null,
    current: null,
    loading: false,
    error: null
}

export default (state = initialState, action) => {
    switch (action.type) {
        case GET_DEVELOPER:
            return {
                type: GET_DEVELOPER,
                developer: action.payload,
                loading: false
            }
        default:
            return state;
    }
}
